import React from "react";
import Item from "./Item.js"
import Num from "./NumArray.js"

class MainContent extends React.Component{
    constructor(){
        super();
        this.state = {
            todos: Num
        }
    }
    render(){
    const arr = this.state.todos.map(function(n){
        return <Item num = {n} />
    })

        return(
            <div className="card">
                {arr}
            </div>
        );
    }
}

export default MainContent;
